import React, { Component } from 'react'

class CropVariety extends Component{
    render(){
        return(
            <div className='APP'>
                这是品种管理,可以从作物的品种类型开始入手,比如花生、大豆、苹果、香蕉等...
            </div>
        )
    }
}
export default CropVariety
